INSERT INTO `m_disease` VALUES ('10015', ' Lung Carcinoma', null, 'Lung cancer is one of the most rapidly increasing morbidity and mortality, and one of the most serious malignancies in population health and life.', '8', '2017-12-14 09:02:40', '20171101060001', '2018-02-15 10:51:37', null, '0');
INSERT INTO `m_disease` VALUES ('10016', '', null, '(AML)(CML)', null, '2017-12-14 09:03:12', '20171101060001', '2018-02-05 11:58:46', null, '1');
INSERT INTO `m_disease` VALUES ('10017', '', null, '', null, '2017-12-14 10:04:24', '20171101060001', '2017-12-14 15:37:27', null, '1');
INSERT INTO `m_disease` VALUES ('10018', 'Gastric Carcinoma', null, 'Gastric cancer refers to the tumor of the epithelial cells, which is formed in the stomach. The early symptoms of gastric cancer are the hindrance after eating, pain and vomiting after eating, and a few patients have hematemesis, black and other symptoms.', '7', '2017-12-14 10:04:24', '20171101060001', '2018-02-15 10:51:37', null, '0');
INSERT INTO `m_disease` VALUES ('10019', '', null, '', null, '2017-12-14 10:04:24', '20171101060001', '2017-12-14 15:37:23', null, '1');
INSERT INTO `m_disease` VALUES ('10020', '', null, '', null, '2017-12-14 10:04:24', '20171101060001', '2017-12-14 15:37:19', null, '1');
INSERT INTO `m_disease` VALUES ('10021', '', null, '', null, '2017-12-14 10:04:24', '20171101060001', '2017-12-14 15:37:15', null, '1');
INSERT INTO `m_disease` VALUES ('10022', 'Nasopharyngeal Carcinoma', null, 'Nasopharyngeal cancer  is a malignant tumor occurring at the top and side of the nasopharyngeal cavity. ', '6', '2017-12-14 15:38:14', '20171101060001', '2018-02-15 10:51:37', null, '0');
INSERT INTO `m_disease` VALUES ('10023', 'Liver Carcinoma', null, 'The liver is the detoxifying organ of our body. The incidence of liver cancer is more subtle and aggressive. The early stage is not easy to detect, and the later growth is rapid, which endangers people\'s life. ', '5', '2017-12-14 15:43:11', '20171101060001', '2018-02-15 10:51:37', null, '0');
INSERT INTO `m_disease` VALUES ('10024', 'Esophageal Carcinoma', null, 'Esophageal cancer is high-incidence in China, which is often found in middle age. It is found that there are many factors of esophageal cancer, such as deficiency of vitamins, trace elements, irregular diet, heredity and exposure to chemical substances.', '4', '2017-12-14 15:43:49', '20171101060001', '2018-02-15 10:51:37', null, '0');
INSERT INTO `m_disease` VALUES ('10025', 'Cervical Carcinoma', null, 'Cervical carcinoma  has decreased in recent years. Smoking, viral infections and bad habits are all factors that contribute to cervical cancer.', '3', '2017-12-14 15:44:08', '20171101060001', '2018-02-15 10:51:37', null, '0');
INSERT INTO `m_disease` VALUES ('10026', 'Breast Carcinoma', null, 'Breast cancer is a common tumor in  female, which threats female\'s life and health. In general, symptoms are more obvious. It is recommended that the majority of women should go to the hospital regularly to check for the reduction of breast cancer, early detection and early treatment.', '2', '2017-12-14 15:44:31', '20171101060001', '2018-02-15 10:51:37', null, '0');
INSERT INTO `m_disease` VALUES ('10027', 'Colorectal Carcinoma', null, 'Colorectal cancer is common in gastrointestinal tractEarly symptoms are not obvious. ', '1', '2017-12-14 15:46:23', '20171101060001', '2018-02-15 10:51:37', null, '0');
INSERT INTO `m_disease` VALUES ('10028', 'Melanoma', null, 'It\'s a kind of malignant tumor that comes from melanocytes. It is common in the skin, also in the mucosa, the eye choroid and other parts.', '0', '2017-12-18 09:53:14', '20171101060001', '2018-02-15 10:51:37', null, '0');
